import React, {useState, useEffect} from 'react';

import '../App.css';
import containerTypeCategoriesAPI from "../api/containerTypeCategoriesAPI";
import ContainerTypeCategory from "./_containerTypeCategory";

const ContainerTypeCategoryPage = ({match}) => {
  // default members to empty array
  const containerTypeCategoryId = match.params.id
  const [containerTypeCategory, setContainerTypeCategory] = useState({});

  useEffect(() => {
    const init = async () => {
      // get members
      const response = await containerTypeCategoriesAPI.getContainerTypeCategory(containerTypeCategoryId);
      if (!response) return;

      // success
      setContainerTypeCategory(response);
    };

    init();
  }, []);

  const editContainerTypeCategory = () => {
    alert('TODO: Edit ContainerTypeCategory')
  }

  return (
    <>
      <div class='breadcrumbs'>
        <a href="/containerTypeCategories">ContainerTypeCategories</a>
        <span>></span>
        {containerTypeCategory.name}
        <span>></span>
        <button onClick={() => editContainerTypeCategory()}>Edit</button>
      </div>

      <div className="box width-400">
        <div className="flex box-title">
          <div className="flex-col-1">
            {containerTypeCategory.name}
          </div>
        </div>
        <div className="plus-8"></div>

        <div className="flex box-row">
          <div className="flex-col-1">
            Name
          </div>
          <div className="flex-col-2">
            {containerTypeCategory.name}
          </div>
        </div>

        <div className="flex box-row">
          <div className="flex-col-1">
            Description
          </div>
          <div className="flex-col-2">
            {containerTypeCategory.description}
          </div>
        </div>

        <div className="plus-8"></div>
      </div>
    </>
  );
}

export default ContainerTypeCategoryPage;

